import React from 'react';
import './Result.scss';
import { Container, Row, Col } from 'reactstrap';
import Mapresult from '../../containers/result/Mapresult';


const Result = () => (
  <Container fluid className="Result">
    <Row>
      <Col xs={12} sm={8}>
        Resultats
      </Col>
      <Col xs={12} sm={4}>
        <Mapresult />
      </Col>
    </Row>
  </Container>
);

export default Result;
